void MainMenu() {
		ST7735_DrawBitmap(0, 160, Menu, 128, 160);                        
		Timer0_Init(check, 2000000);   																		// Keep polling the slide pot using Timer0
		menu_flag=1;																											// Set menu music flag
		Timer1_Init(sound_play, 7200);																		// Plays menu screen music from sound.c file repeatedly

		while(1){

			if (data < 2043)
			{
				ST7735_DrawBitmap(0,102,Line, 45, 2);
				ST7735_DrawBitmap(78,102,BLine, 45, 2);
				if((GPIO_PORTB_DATA_R & 0x10) == 0x10)												// IF select button is pressed, player has selected How to play
				{
					TIMER1_CTL_R = 0x00000000;																	// Turn off Timer1 (menu screen music = stop)
					menuSelect_flag = 1;																				// Set select music flag
					menu_flag=0;																								// Turn off menu music flag
					TIMER0_CTL_R = 0x00000000;																	// Turn off Timer0 (stop polling the slide pot)
					Timer1_Init(sound_play, 7256);															// Play the Selected music
					
				  howto();}}																									// "How to" screen begins
			if (data>2043)
				{
				ST7735_DrawBitmap(0,102,BLine, 45, 2);
				ST7735_DrawBitmap(78,102,Line, 45, 2);
				if((GPIO_PORTB_DATA_R & 0x10) == 0x10)												// IF select button is pressed, player has selected to play the game
				{
					TIMER1_CTL_R = 0x00000000;																	// Turn off Timer1 (menu screen music = stop)
					menuSelect_flag = 1;																				// Set select music flag
					menu_flag=0;																								// Turn off menu music flag
					TIMER0_CTL_R = 0x00000000;																	// Turn off Timer0 (stop polling the slide pot)
					Timer1_Init(sound_play, 7256);															// Play the Selected music
					
					 choosespeed(0);																						// "Speed" Menu is called
				}}}}


